import React from "react";
import { Text, View } from "react-native";

const LoginForm = () => {
  return (
    <View
      style={{
        flex: 1,
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <Text>This is the login page</Text>
    </View>
  );
};
export default LoginForm;
